import React from 'react';

import styles from './order.module.css';

const Order = (props) => {

    
    return (
    <div className={styles.Order}>
        <p>Ingredients: Salad (1)</p>
        <p>Price: <strong>{Number.parseFloat(props.price).toFixed(2)} CAD</strong></p>
    </div>
    );
};

export default Order;
